位於蘇花公路東澳灣最南端的粉鳥林，有著獨特隱蔽的地理位置，景色怡人、海水清澈、是個充滿寧謐與純樸之美的僻靜天地。據傳此地昔日是野鴿子群聚的天堂，因而命名”粉鳥林”。今建有一小型漁港，即粉鳥林漁港，漁港雖不大，但港前的東澳灣優美的柔美弧線襯著蔚藍深邃的海洋，加上碧綠青山偎傍湛藍海水，被公認為世界級海岸的絕色風景，早已成為東海岸行旅者必訪之處。另漁港旁有一處因礁岩地形而多有嶙峋奇岩怪石的海域，也吸引了許多遊客及攝影人士前往一窺秘境。粉鳥林漁港擁有多種魚類，許多釣客也常群聚於此垂釣，或是搭船出海體驗海釣趣味。但自蘇花改開通後，此地遊客擁擠，攤販紛亂，有待相關單位積極整合加強改善，以免破壞景觀與自然資產。

